import React, { useState } from 'react';
import { Link, useNavigate } from 'react-router-dom';
import { 
  Box, Typography, Divider, Tabs, Tab, Table, TableBody, TableCell, 
  TableContainer, TableHead, TableRow, Paper, Card, CardContent, Button, 
  Grid, IconButton, List, ListItem, ListItemText
} from '@mui/material';
import {
  Menu as MenuIcon,
  ExitToApp as ExitToAppIcon,
  AccountBalanceWallet as AccountBalanceWalletIcon,
  ArrowDownward as ArrowDownwardIcon,
  Group as GroupIcon,
  GroupAdd as GroupAddIcon,
  AccountCircle as AccountCircleIcon,
  Rule as RuleIcon,
  HelpOutline as HelpOutlineIcon,
  Security as SecurityIcon,
  Assignment as AssignmentIcon
} from '@mui/icons-material';
import FooterMenu from '../Footer.jsx';
import './General.css';

const transactions = {
  charges: Array.from({ length: 10 }, (_, i) => ({
    email: `user${i + 1}***@example.com`,
    amount: `${(Math.random() * (500 - 10) + 10).toFixed(2)} USDT`,
  })),
  withdrawals: Array.from({ length: 10 }, (_, i) => ({
    email: `user${i + 11}***@example.com`,
    amount: `${(Math.random() * (500 - 10) + 10).toFixed(2)} USDT`,
  })),
};

const General = () => {
  const [selectedTab, setSelectedTab] = useState(0);
  const [menuOpen, setMenuOpen] = useState(false);
  const navigate = useNavigate();

  const toggleMenu = () => setMenuOpen(!menuOpen);
  const logout = () => {
    localStorage.removeItem('authToken');
    navigate('/login');
  };

  return (
    <div className="general-container">
      {/* Header */}
      <div className="header">
        <IconButton onClick={toggleMenu}>
          <MenuIcon />
        </IconButton>
        <button className="logout-btn" onClick={logout}>
          <ExitToAppIcon />
          Logout
        </button>
      </div>

      {/* Side Menu */}
      <nav className={`side-menu ${menuOpen ? 'open' : ''}`}>
        <List>
          {[
            { text: 'Company Profile', icon: <AccountCircleIcon />, link: '/company-profile' },
            { text: 'Platform Rules', icon: <RuleIcon />, link: '/platform-rules' },
            { text: 'Common Problems', icon: <HelpOutlineIcon />, link: '/common-problems' },
            { text: 'Security Center', icon: <SecurityIcon />, link: '/security-center' },
            { text: 'Funding Details', icon: <AccountBalanceWalletIcon />, link: '/funding-details' },
            { text: 'Invite Friends', icon: <GroupAddIcon />, link: '/invite-friends' },
            { text: 'My Team', icon: <GroupIcon />, link: '/my-team' },
            { text: 'Quotation Tutorial', icon: <AssignmentIcon />, link: '/quotation-tutorial' },
          ].map(({ text, icon, link }) => (
            <ListItem button component={Link} to={link} key={text}>
              {icon}
              <ListItemText primary={text} />
            </ListItem>
          ))}
        </List>
      </nav>

      {/* Content */}
      <main className={`profile-content ${menuOpen ? 'expanded' : ''}`}>
        <Card className="profile-card">
          <CardContent>
            <Typography variant="h4" align="center" sx={{ mb: 3 }}>
              General Overview
            </Typography>
            <Divider sx={{ mb: 3 }} />

            {/* Action Buttons */}
            <Grid container spacing={2} justifyContent="center" sx={{ mb: 3 }}>
              {[
                { text: 'Recharge', color: 'primary', icon: <AccountBalanceWalletIcon /> },
                { text: 'Withdraw', color: 'secondary', icon: <ArrowDownwardIcon /> },
                { text: 'Team', color: 'success', icon: <GroupIcon /> },
                { text: 'Invite', color: 'warning', icon: <GroupAddIcon /> },
              ].map(({ text, color, icon }, index) => (
                <Grid item xs={6} sm={3} key={index}>
                  <Button fullWidth variant="contained" color={color} startIcon={icon}>
                    {text}
                  </Button>
                </Grid>
              ))}
            </Grid>

            {/* Transactions Tab */}
            <Box sx={{ width: '100%', mt: 3 }}>
              <Tabs value={selectedTab} onChange={(e, newValue) => setSelectedTab(newValue)} indicatorColor="primary" textColor="primary" centered>
                <Tab label="Recent Charges" />
                <Tab label="Recent Withdrawals" />
              </Tabs>

              <TableContainer component={Paper} sx={{ mt: 2 }}>
                <Table>
                  <TableHead>
                    <TableRow>
                      <TableCell>Email</TableCell>
                      <TableCell>Amount (USDT)</TableCell>
                    </TableRow>
                  </TableHead>
                  <TableBody>
                    {transactions[selectedTab === 0 ? 'charges' : 'withdrawals'].map((item, index) => (
                      <TableRow key={index}>
                        <TableCell>{item.email}</TableCell>
                        <TableCell>{item.amount}</TableCell>
                      </TableRow>
                    ))}
                  </TableBody>
                </Table>
              </TableContainer>
            </Box>
          </CardContent>
        </Card>

        {/* Footer */}
        <FooterMenu />
      </main>
    </div>
  );
};

export default General;
